package com.yeadun.testutil.product.model;import java.util.HashMap;public class P100005 implements Product{    private String retCode;    private String retDesc;    private String bindId;    public String getRetCode() {        return retCode;    }    public void setRetCode(String retCode) {        this.retCode = retCode;    }    public String getRetDesc() {        return retDesc;    }    public void setRetDesc(String retDesc) {        this.retDesc = retDesc;    }    public String getBindId() {        return bindId;    }    public void setBindId(String bindId) {        this.bindId = bindId;    }    public String toString(){        return "retCode - " + retCode + ", retDesc - " + retDesc + ", bindId - " + bindId;    }    @Override    public HashMap<String, String> pojo2Map() {        HashMap<String, String > result = new HashMap<>();        result.put("retCode", this.retCode);        result.put("retDesc", this.retDesc);        result.put("bindId", this.bindId);        return result;    }}